import React from "react";


import company from'../../../imgs/company.png';
import Face from '../../../imgs/Face.png';
import In from '../../../imgs/In.png';
import Insta from '../../../imgs/Insta.png';


import './Styles.css';


const Footer = () => {


    return (
        <div id="Footer">
            <a href="https://www.wpp.com/" target="_blank" rel="noreferrer"><img id="Company" src={company} alt="company"/></a>
            <a href="https://www.facebook.com/agencia.jussi" target="_blank" rel="noreferrer"><img id="Face" class="social" src={Face} alt="facbook" /></a>
            <a href="https://www.instagram.com/jussi/" target="_blank" rel="noreferrer"><img id="Insta" class="social" src={Insta} alt="insta" /></a>
            <a href="https://www.linkedin.com/company/agencia-jussi/" target="_blank" rel="noreferrer"><img id="In" class="social" src={In} alt="linkedin" /></a>
        </div>

    )
}

export default Footer;
